[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "BRCA1 human", "limit": 5}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "BRCA1 AND human[organism]", "max_results": 5}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "clinvar", "query": "BRCA1 AND pathogenic", "max_results": 20}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "clinvar", "ids": ["4686632", "4686574", "4686571", "4686569", "4686568", "4686567", "4686566", "4686565", "4685439", "4685271"]}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["7157"]}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
