PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT DISTINCT ?variant ?title ?clinical_significance ?gene ?disease
WHERE {
  ?variant rdf:type cvo:VariationArchiveType ;
           cvo:title ?title ;
           cvo:interpreted_record ?record .

  ?record cvo:rcv_list/cvo:rcv_accession ?rcv .
  ?rcv cvo:clinical_assertion_list/cvo:germline_list/cvo:germline/cvo:description ?clinical_significance ;
       cvo:classified_record ?classified .

  ?classified cvo:simple_allele ?allele .
  ?allele cvo:gene_list/cvo:gene/cvo:symbol ?gene .

  ?rcv cvo:trait_set_list/cvo:trait_set/cvo:trait_list/cvo:trait/cvo:name ?disease .

  FILTER(CONTAINS(?title, "BRCA1"))
  FILTER(CONTAINS(LCASE(?clinical_significance), "pathogenic"))
  FILTER(?gene = "BRCA1")
}
LIMIT 20"}}, {"name": "mcp__pubmed__search_articles", "input": {"query": "BRCA1 pathogenic variants disease", "max_results": 10}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>
PREFIX med2rdf: <http://med2rdf.org/ontology/med2rdf#>
PREFIX sio: <http://semanticscience.org/resource/>

SELECT DISTINCT ?variant ?var_label ?significance ?disease_name
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  VALUES ?gene_uri { <http://ncbi.nlm.nih.gov/gene/672> }
  ?gene_bn med2rdf:gene ?gene_uri .
  ?classrec sio:SIO_000628 ?gene_bn .
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?var_label ;
           cvo:classified_record ?classrec ;
           cvo:record_status "current" .

  OPTIONAL {
    ?classrec cvo:classifications/cvo:germline_classification/cvo:description ?significance .
    FILTER(CONTAINS(LCASE(?significance), "pathogenic"))
  }

  OPTIONAL {
    ?variant med2rdf:disease ?disease .
    ?disease cvo:name/rdfs:label ?disease_name .
  }

  FILTER(BOUND(?significance))
}
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>
