"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?pdbId ?method ?resolution
WHERE {
  <http://purl.uniprot.org/uniprot/P38398> rdfs:seeAlso ?pdb .
  ?pdb up:database <http://purl.uniprot.org/database/PDB> .

  OPTIONAL {
    ?pdb up:method ?method .
  }
  OPTIONAL {
    ?pdb up:resolution ?resolution .
